 <div class=&quot;bg-blue-50 p-5 rounded-lg mb-8 border-l-4 border-blue-500&quot;>
 <p class=&quot;text-gray-700 leading-relaxed&quot;>
 This Post Distribution Monitoring (PDM) report evaluates multiple service distributions implemented under the GPE Fund project between December 2023 and April 2025, covering heating systems, school furniture, eco-friendly containers, hospitality supplies, and cleaning materials across 17 schools in Idleb governorate.
 </p>
